import React from 'react'
import data from '../data.js';

const Galery = () => {
	return (
		<div>
			<div className="gallery">
				{data.map((photo, index) => (
					<div className="picContainer" key={index}>
						<img src={photo.picture} alt={photo.category} />
					</div>
				))}
			</div>
		</div>
	)
}

export default Galery
